def atMostNGivenDigitSet(digits, n):
    """"""
    digits = set((int(d) for d in digits))
    n = [int(d) for d in str(n)]
    (m, res) = (len(digits), 0)
    for i in range(1, len(n)):
        res += m ** i
    for (i, x) in enumerate(n):
        res += sum((d < x for d in digits)) * m ** (len(n) - i - 1)
        if x not in digits:
            break
    else:
        res += 1
    return res
